import faker from 'faker';

const expertList = [
    {
        "key": 0,
        "avatar": faker.image.avatar(),
        "name": `${faker.name.firstName()} ${faker.name.lastName()}`,
        "jobTitle": faker.name.jobTitle(),
        "description": faker.company.catchPhrase(),
    },
    {
        "key": 1,
        "avatar": faker.image.avatar(),
        "name": `${faker.name.firstName()} ${faker.name.lastName()}`,
        "jobTitle": faker.name.jobTitle(),
        "description": faker.company.catchPhrase(),
    },
    {
        "key": 2,
        "avatar": faker.image.avatar(),
        "name": `${faker.name.firstName()} ${faker.name.lastName()}`,
        "jobTitle": faker.name.jobTitle(),
        "description": faker.company.catchPhrase(),
    },
    {
        "key": 3,
        "avatar": faker.image.avatar(),
        "name": `${faker.name.firstName()} ${faker.name.lastName()}`,
        "jobTitle": faker.name.jobTitle(),
        "description": faker.company.catchPhrase()
    }

]

export default expertList;
